import { createContext } from 'react';

import './App.css';
import Counter from './Counter';
import Welcome from './Welcome';
import Profile from './Profile';
import DisplayPicture from './DisplayPicture';

function App() {

  const FrameworkContext = createContext({
    framework: 'React',
  });

  const handleCount = () => {
    alert('Count Function has been triggered');
  };

  return (
    <div className='App'>
      <FrameworkContext.Provider>

        <header>
          <h1>
            Bug Log
          </h1>
        </header>

        <Welcome num={4} />

        <Counter
          countVar={0}
          countObject={
            {
              title: 'bug',
              startCount: 0
            }
          }
          countFunction={handleCount}
        />

        <Profile>
          <DisplayPicture />
        </Profile>
      </FrameworkContext.Provider>
    </div>
  );
}

export default App;
